const withFonts = require('next-fonts');

module.exports = withFonts({
  assetPrefix: 'https://fonts.googleapis.com/css2?family=Montserrat:ital,wght@0,200;0,400;0,700;0,900;1,400&display=swap',
  webpack(config, options) {
    return config;
  },
});
